import React from 'react';
import axios from 'axios';

class Cart extends React.Component {
    // cartItems = this.state.cartItems;
    constructor(props){
        super(props);
        this.state = {
            cartItems:props.cartItems
        }
    }
    render(props){
        return(
            <div>
                <ul>
                    {this.state.cartItems.map(item => 
                        <li>
                            {item.name} ${item.price}
                        </li>)
                    }
                </ul>
                <p>Subtotal: </p>
                <p>Total Taxes: </p>
                <p>Total: </p>
            </div>
        );
    }

}

export default Cart;
